import React, { Component } from 'react';
import './search-menu.scss';

class SearchMenu extends Component {
    state = {
        menu: {
            creatures: {
                elementType: 'checkbox-v1',
                elementConfig: {
                    name: 'creature',
                    options: [
                        {text: 'robot-v1', displayText: "RobotV1", value:''},
                        {text: 'robot-v2', displayText: "RobotV2", value:''},
                        {text: 'monster', displayText: "Monster", value:''},
                        {text: 'cat', displayText: "cat", value:''}
                    ]
                },
                value: '',
                validation: {},
                valid: false,
                touched: true,
                label: true
            },
            price: {
                elementType: 'checkbox-v1',
                elementConfig: {
                    name: 'price',
                    options: [
                        {text: '0', displayText: "Under $1", value:''},
                        {text: '1', displayText: "$1 to $2", value:''},
                        {text: '2 above', displayText: "$2 and Above", value:''}
                    ]
                },
                value: '',
                validation: {},
                valid: false,
                touched: true,
                label: true
            },
            time: {
                elementType: 'monster',
                elementConfig: {
                    name: 'accept',
                    options: [
                        {text: 'today', displayText: "Today", value:''},
                        {text: 'this week', displayText: "This Week", value:''},
                        {text: 'this month', displayText: "This Month", value:''}
                    ]
                },
                value: '',
                validation: {},
                valid: false,
                touched: true,
                label: true
            },
        }
    };

    render () {
        return (
            <div className="search-menu">
                <div className="search-menu-item">
                    <div className="search-menu-item-btn">hello</div>
                    dfsdfsdf
                </div>
                <div className="search-menu-item">
                    <div className="search-menu-item-btn">hello</div>
                    fdsf
                </div>
                <div className="search-menu-item">
                    <div className="search-menu-item-btn">hello</div>
                </div>
            </div>
        );
    }
};

export default SearchMenu;
